const MenuBlock = ({ title, index, onClick }) => {
  return (
    <div>
      <a onClick={onClick}>
        <div className={`block-option ${index}`}>
          <h2 className={index}>{title}</h2>
        </div>
      </a>
    </div>
  );
};

export default MenuBlock;
